import React, {Component} from 'react';
import './App.css';

class App extends Component {
 state ={
  value : 0
 };


 render(){   

    const { value}  = this.state;

    return (
      <div className="App">

        <h1>{value}</h1>  
        <button onClick={()=> value++} >+</button>   

      </div>
    );
}

 }


export default App;
